import React from 'react';
import NavBarSignIn from './NavBarSignIn';
import "./SignIn.css";

function SignIn(){
    var x = document.getElementById("LogIn");
   	var y = document.getElementById("Register");
    var z = document.getElementById("BTN");

    function register(){
    	x.style.left =  "-400px";
    	y.style.left = "50px";
    	z.style.left = "110px";
    }

    function login(){
    	x.style.left =  "50px";
    	y.style.left = "450px";
    	z.style.left = "0px";
    }

	return(
		<div classNameNameName="SignIn">
			<div classNameNameName="NavBarSignIn">
				<NavBarSignIn/>

				<div className="Form_box">
					<div className="Button_Box">
						<div id="BTN"></div>
						<button type="button" className="Button" onClick={login}>
							LogIn
						</button>
						<button type="button" className="Button" onClick={register}>
							Register
						</button>
					</div>
					<form id="LogIn" className="Input">
						<input type="text" className="Input-Field" placeholder="Login" required=""/>
						<input type = "password" className ="Input-Field" placeholder="Password" required=""/>
						<input type="checkbox" className="Checkbox"/>
						<span>
							Remember Passeword
						</span>
						<button type="submit" className="Submit"> 
							<a href = "Home.html"> Log In</a>
						</button>
					</form>

					<form id="Register" className="Input">
						<input type="text" className="Input-Field" placeholder="Login" required=""/>
						<input type="email" className="Input-Field" placeholder="Email" required=""/>
						<input type = "password" className ="Input-Field" placeholder="Password" required=""/> 
						<input type="checkbox" className="Checkbox" required=""/>
						<span>
							I agree to the terms & conditions
						</span>
						<button type="submit" className="Submit">
							<a href = "Register.html"> Suivant</a>
						</button>
					</form>
				</div>
			</div>

		</div>
	)
}

export default SignIn;
